ISLAMABAD, Aug 10 (APP): Prime Minister Muhammad Shehbaz Sharif here on Thursday held a meeting with Chairman Senate Muhammad Sadiq Sanjrani and discussed the prevailing political situation in the country.
The Chairman Senate paid tribute to the prime minister for amicably leading the coalition government for 15 months and for stabilizing the economy.
